  const [letterClass, setLetterClass] = useState("text-animate");
  const [searchQuery, setSearchQuery] = useState("");
  const [loading, setLoading] = useState(false);

  console.log(data);

  useEffect(() => {
    const timer = setTimeout(() => {
      setLetterClass("text-animate-hover");
